Action Comics v1 #829
Publisher:  DC Comics
Publication Date:  September 2005

Writer:  Gail Simone
Penciller:  John Byrne
Inker:  Nelson DeCastro
Colorist:  Guy Major
Cover Artist:  Tony Salvador Daniel, Dexter Vines, and Guy Major

Continuing the &quot;Sacrifice&quot; storyline from SUPERMAN #219. Concerned for Superman's mental state, the JLA confronts the Man of Steel to help him remember the previous day's events. However, instead of fighting Brainac, the Last Son faces off against Darkseid! Continues in ADVENTURES OF SUPERMAN #642.

Thanks goes to DreamGirl for this release.

